syntax = "proto2";

package ru.mail.go.webbase;

option java_outer_classname = "FbQddbClinkrank";

message ClickRankResult
{
    required string url = 1;
    required string query = 2;
    required string searcher = 3;
    required uint64 clicks = 4;
    required uint64 shows = 5;
    optional uint64 pos = 6;
    optional uint64 satisfyClicks = 7;
    optional uint64 userSeen = 8;
}
